        function getEqnList() {

          str += "<center><h3>Equations</h3></center>";
          str += "<table width='90%' align='center' border='1' cellpadding='0' cellspacing='0'>";

            str += retUimEqn(uimSignals[s]);
            str += "</td></tr>";
          }
          for (s=0; s<signals.length; s++) {
            str += "<tr><td>";

            str += "</td></tr>";
          }

            str += "onmouseout=\"window.status=''\">";

            str += "<td align='right'>";

            str += "<td align='right'>";

            str += "print page</a>";

          }

          str += "</span></form>";
          str += "</body></html>";
          return str;
